import React, {Component} from 'react';
import skills from './skills'

class Skills extends Component{
    // constructor(){
    //     super();
    // }

    render(){
        const skillRow = skills.map((skill,i)=>{
            return(
                <div key={i}>
                    <tr>
                        <td>{skill.category}</td>
                        <td>{skill.name}</td>
                        <td>{skill.initValue}</td>
                    </tr>
                </div>
            )
        })

        return(
            <div>
                <h2>Sample</h2>
                <table>
                    <tr>
                        <td>カテゴリ</td>
                        <td>技能名</td>
                        <td>初期値</td>
                        <td>職業P</td>
                        <td>興味P</td>
                    </tr>
                    {skillRow}
                </table>
            </div>
        )
    }
}

export default Skills;
